import React from 'react';

function Resume(){
    return (
        <section className='flex-row'>
            <div>
            <h2>Edmer Valencia</h2>
            <h3> Software Developer</h3>
            </div>
            <div>
            <h4> Programs learned</h4>
        Html, CSS, NODE, REST API, Git, Express.js, Node.js, React.
            </div>
        </section>
    )

}
